import React, { useState } from 'react';
import { 
  FileText, 
  Calendar, 
  Users, 
  DollarSign,
  BarChart3,
  MessageSquare,
  Settings,
  Vote
} from 'lucide-react';
import PortalLayout from './PortalLayout';

const BoardPortal = () => {
  const [activeTab, setActiveTab] = useState('dashboard');

  const boardTabs = [
    { id: 'dashboard', label: 'Dashboard', icon: BarChart3 },
    { id: 'documents', label: 'Documents', icon: FileText },
    { id: 'meetings', label: 'Meetings', icon: Calendar },
    { id: 'financials', label: 'Financials', icon: DollarSign },
    { id: 'members', label: 'Member Info', icon: Users },
    { id: 'voting', label: 'Voting', icon: Vote },
    { id: 'communications', label: 'Communications', icon: MessageSquare },
    { id: 'settings', label: 'Settings', icon: Settings }
  ];

  const renderTabContent = () => {
    switch (activeTab) {
      case 'dashboard':
        return <BoardDashboard />;
      case 'documents':
        return <BoardDocuments />;
      case 'meetings':
        return <MeetingManagement />;
      case 'financials':
        return <FinancialOverview />;
      case 'members':
        return <MemberInfo />;
      case 'voting':
        return <VotingCenter />;
      case 'communications':
        return <CommunicationCenter />;
      case 'settings':
        return <BoardSettings />;
      default:
        return <BoardDashboard />;
    }
  };

  return (
    <PortalLayout
      title="Board Member Portal"
      subtitle="Enhanced access for board member responsibilities"
      tabs={boardTabs}
      activeTab={activeTab}
      onTabChange={setActiveTab}
      userRole="board"
    >
      {renderTabContent()}
    </PortalLayout>
  );
};

const BoardDashboard = () => {
  const stats = [
    { label: 'Active Members', value: '127', icon: Users, color: 'blue' },
    { label: 'Monthly Revenue', value: '$24,300', icon: DollarSign, color: 'green' },
    { label: 'Pending Issues', value: '8', icon: MessageSquare, color: 'yellow' },
    { label: 'Next Meeting', value: '3 days', icon: Calendar, color: 'purple' }
  ];

  const recentActivities = [
    'Financial report for Q1 2024 completed',
    'New landscape proposal submitted',
    'Pool maintenance scheduled for next week',
    'Annual meeting agenda finalized',
    'Security patrol schedule updated'
  ];

  const upcomingItems = [
    { type: 'Meeting', title: 'Monthly Board Meeting', date: 'March 15, 2024', time: '7:00 PM' },
    { type: 'Deadline', title: 'Budget Review Due', date: 'March 20, 2024', time: '5:00 PM' },
    { type: 'Event', title: 'Community BBQ Planning', date: 'March 25, 2024', time: '6:00 PM' }
  ];

  return (
    <div className="space-y-6">
      {/* Stats Grid */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
        {stats.map((stat, index) => (
          <div key={index} className="backdrop-blur-lg bg-white/10 rounded-xl p-6 border border-white/20">
            <div className="flex items-center justify-between">
              <div>
                <p className="text-blue-200 text-sm">{stat.label}</p>
                <p className="text-2xl font-bold text-white">{stat.value}</p>
              </div>
              <div className={`p-3 bg-${stat.color}-500/20 rounded-lg`}>
                <stat.icon className={`w-6 h-6 text-${stat.color}-300`} />
              </div>
            </div>
          </div>
        ))}
      </div>

      <div className="grid grid-cols-1 lg:grid-cols-2 gap-6">
        {/* Recent Activity */}
        <div className="backdrop-blur-lg bg-white/10 rounded-xl p-6 border border-white/20">
          <h3 className="text-lg font-semibold text-white mb-4">Recent Activity</h3>
          <div className="space-y-3">
            {recentActivities.map((activity, index) => (
              <div key={index} className="text-blue-200 text-sm p-3 bg-white/5 rounded-lg">
                {activity}
              </div>
            ))}
          </div>
        </div>

        {/* Upcoming Items */}
        <div className="backdrop-blur-lg bg-white/10 rounded-xl p-6 border border-white/20">
          <h3 className="text-lg font-semibold text-white mb-4">Upcoming</h3>
          <div className="space-y-3">
            {upcomingItems.map((item, index) => (
              <div key={index} className="p-3 bg-white/5 rounded-lg">
                <div className="flex justify-between items-start">
                  <div>
                    <span className="text-blue-300 text-xs font-medium">{item.type}</span>
                    <p className="text-white text-sm font-medium">{item.title}</p>
                    <p className="text-blue-200 text-xs">{item.date} at {item.time}</p>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

const BoardDocuments = () => (
  <div className="backdrop-blur-lg bg-white/10 rounded-xl p-6 border border-white/20">
    <h3 className="text-lg font-semibold text-white mb-4">Board Documents</h3>
    <p className="text-blue-200">Access to confidential board documents and materials...</p>
  </div>
);

const MeetingManagement = () => (
  <div className="backdrop-blur-lg bg-white/10 rounded-xl p-6 border border-white/20">
    <h3 className="text-lg font-semibold text-white mb-4">Meeting Management</h3>
    <p className="text-blue-200">Schedule meetings, manage agendas, and record minutes...</p>
  </div>
);

const FinancialOverview = () => (
  <div className="backdrop-blur-lg bg-white/10 rounded-xl p-6 border border-white/20">
    <h3 className="text-lg font-semibold text-white mb-4">Financial Overview</h3>
    <p className="text-blue-200">Financial reports, budgets, and expense tracking...</p>
  </div>
);

const MemberInfo = () => (
  <div className="backdrop-blur-lg bg-white/10 rounded-xl p-6 border border-white/20">
    <h3 className="text-lg font-semibold text-white mb-4">Member Information</h3>
    <p className="text-blue-200">View member details and community information...</p>
  </div>
);

const VotingCenter = () => (
  <div className="backdrop-blur-lg bg-white/10 rounded-xl p-6 border border-white/20">
    <h3 className="text-lg font-semibold text-white mb-4">Voting Center</h3>
    <p className="text-blue-200">Manage board votes and community decisions...</p>
  </div>
);

const CommunicationCenter = () => (
  <div className="backdrop-blur-lg bg-white/10 rounded-xl p-6 border border-white/20">
    <h3 className="text-lg font-semibold text-white mb-4">Communication Center</h3>
    <p className="text-blue-200">Send announcements and communicate with members...</p>
  </div>
);

const BoardSettings = () => (
  <div className="backdrop-blur-lg bg-white/10 rounded-xl p-6 border border-white/20">
    <h3 className="text-lg font-semibold text-white mb-4">Board Settings</h3>
    <p className="text-blue-200">Configure board-specific settings and preferences...</p>
  </div>
);

export default BoardPortal;
